INSERT INTO `m_questions` VALUES ('Q360','36','Are you related by consanguinity or affinity to any of the following:',0,'2010-07-29 07:09:21'),('Q361','a','Within the third degree (for National Government Employees): appointing authority, recommending authority, chief of office/bureau/department or person who has immediate supervision over you in the Office, Bureau or Department where you will be appointed?',1,'2010-07-29 07:09:21'),('Q362','b','Within the fourth degree (for Local Government Employees): appointing authority or recommending authority where you will be appointed?',1,'2010-07-29 07:09:21'),('Q370','37','',0,'2010-07-29 07:09:21'),('Q371','a','Have you ever been formally charged?',1,'2010-07-29 07:09:21'),('Q372','b','Have you ever been guilty of any administrative offense?',1,'2010-07-29 07:09:21'),('Q380','38','Have ever been convicted of any crime or violation of any law, decree, ordinance or regulation by any court or tribunal?',1,'2010-07-29 07:09:21'),('Q390','39','Have you ever been separated from the service in any of the following modes: resignation, retirement, dropped from the rolls, dismissal, termination, end of term, finished contract, AWOL or phased out, in the public or private sector?',1,'2010-07-29 07:09:21'),('Q400','40','Have you ever been a candidate in a national or local election (except barangay election)?',1,'2010-07-29 07:09:21'),('Q410','41','Pursuant to: (a) Indegenous People\'s Act (RA 8371); (b) Magna Carta for Disabled Persons (RA 7277); and (c) Solo Parents Welfare Act of 2000 (RA 8972), please answer the following items:',0,'2010-07-29 07:09:21'),('Q411','a','Are you a member of any indigenous group?',1,'2010-07-29 07:09:21'),('Q412','b','Are you defferently abled?',1,'2010-07-29 07:09:21'),('Q413','c','Are you a solo parent?',1,'2010-07-29 07:09:21');
